Are you a teacher? Do you have a special student who deserves recognition? Maybe a student who is struggling and needs encouragement? Perhaps a student who has shown improvement that you want to reward? Here is your chance! One deserving student will be selected to receive two tickets to attend a Rockets game and sit court side at the scorer’s table. These are my personal seats and are the best in the house! The tickets come with loading dock parking and VIP lounge access. Here are my rules, no exceptions: 

1. the nominated student must be under the age of 18; 
2. only a teacher of that student can nominate the student; 
3. the nominating teacher must post a video, no longer than 30 seconds, on Instagram and MUST tag me; and
4. the video should succinctly explain why the student deserves the tickets and recognition. 

Let’s go teachers! I look forward to the submissions and learning about all your outstanding students. I can’t wait to be watching on TV and see that deserving student high-fiving the Rockets players court side. You have until Jan. 15 to post and tag. Get busy and good luck!!

