The Buzbee Law Firm filed a defamation lawsuit today in Houston state court on behalf of social media influencer Eric Vaughn. The case was filed against failed Delaware Senate Candidate and sometime political commentator Lauren Witzke.  Ms. Witzke is apparently oblivious to similar cases in Texas, such as that involving Alex Jones, where juries frown upon blatant misinformation and defamation. She is obviously also ignorant of the laws regarding slander that apply in our great state. As set forth in the case, Ms. Witzke recklessly and maliciously referred to my client, Eric Vaughn, as a pedophile and human sexual trafficker, solely because he and his husband used a legal surrogate to start their beautiful family. As an aside, only the most rancid, hateful and nasty person could look at Mr. Vaughn’s loving family and have such a vile, ignorant, and disgusting reaction. Again, as set forth in our filing, specifically calling someone a pedophile or human sexual trafficker is libel per se in the state of Texas. It is clear that Ms. Witzke published her false comments with malice; we therefore seek punitive damages to make an example of her and to discourage her from making such comments about anyone else in the future. We know, of course, that with a lawsuit we will never be able to make Ms. Witzke a good person or convince her to be one; but, at the least, in this lawsuit we look forward to educating Ms. Witzke and her ilk on Texas law. In response to the myriad requests to withdraw her comments, Ms. Witzke recently said she actually looked forward to being sued for her slander--to this I can only say, “Be careful what you ask for.”

