City government touches almost every aspect of your daily life, from road condition, busted water mains, sewage, policing, public safety, trash pickup, first responders, and permitting;
District G is one of 16 council districts in the city of Houston;
There are 200,000+ registered voters in District G (only about 30,000 routinely vote!);
District G is long and narrow running along Memorial Drive from River Oaks at Kirby Drive all the way to Highway 6;
District G generates approximately 37 percent of city revenues (it is the golden goose) but receives less then 10 percent of city services;
The current District G council member has had little involvement in the District G community when compared to previous District G council members; 
Houston has a strong mayoral form of government—the mayor sets the agenda and runs the show;
District G needs a very strong and very skilled voice to represent its residents. The current incumbent council member for District G has been grossly ineffective (and she voted to raise our taxes—TWICE!). We have to do better. We will do better. I’m looking forward to representing District G! Join us!

